import React from 'react';
import logo from './logo.svg';
import './css/App.scss';
import Home from './pages/Home';
import {spacer1, spacer2, spacer3, spacer4} from './components/constants';

function App() {
  return (
    <div className="App" style={{margin: $spacer3}}>
      <Home />
    </div>
  );
}

export default App;
